import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  text-align: center;
`;

// Future: Use `isAuthedUser` to determine whether to show delete message controls
function ZeroState({ title, body }) {
  return (
    <Wrapper>
      <span className="d-block h4">{title}</span>
      <span className="d-block">
        <small>{body}</small>
      </span>
    </Wrapper>
  );
}

export default ZeroState;
